webpackJsonp([0xa65148a8ccab],{858:function(n,e){n.exports={data:{post:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/posts/2017-12-04--phpstorm-remote-setting/index.md absPath of file >>> MarkdownRemark",html:'<h2>Xdebug?</h2>\n<ul>\n<li>デバック及びプロファイリング機能を提供するPHP拡張モデュール</li>\n<li>PECLを用いてインストール可能</li>\n</ul>\n<h2>1. Xdebugをインストール（CentOS）</h2>\n<h3>php-devel、php-pearをインストール</h3>\n<div class="gatsby-highlight">\n      <pre class="language-command"><code class="language-command">yum install php-devel\nyum install php-pear</code></pre>\n      </div>\n<h3>gcc、gcc-c++、autoconf、automakeをインストール</h3>\n<div class="gatsby-highlight">\n      <pre class="language-command"><code class="language-command">yum install gcc gcc-c++ autoconf automake</code></pre>\n      </div>\n<h3>Xdebugをインストール</h3>\n<div class="gatsby-highlight">\n      <pre class="language-command"><code class="language-command">pecl install Xdebug\n\n// ※エラーになる場合\n// yum --enablerepo=remi-phpバージョン install php-devel php-pear\nyum --enablerepo=remi-php56 install php-devel php-pear</code></pre>\n      </div>\n<h3>/etc/php.iniを修正</h3>\n<div class="gatsby-highlight">\n      <pre class="language-command"><code class="language-command">vi /etc/php.ini</code></pre>\n      </div>\n<p>↓以下を追加</p>\n<div class="gatsby-highlight">\n      <pre class="language-json"><code class="language-json"><span class="token punctuation">[</span>xdebug<span class="token punctuation">]</span>  \nzend_extension=<span class="token string">"/usr/lib64/php/modules/xdebug.so"</span>  \nxdebug.default_enable = <span class="token number">1</span>  \nxdebug.remote_enable = <span class="token number">1</span>  \nxdebug.remote_port = <span class="token number">9000</span>  \nxdebug.remote_handler = dbgp  \nxdebug.remote_autostart = <span class="token number">1</span>  \nxdebug.profiler_output_dir = <span class="token string">"/tmp"</span>  \nxdebug.max_nesting_level = <span class="token number">1000</span>  \nxdebug.idekey = <span class="token string">"PHPSTORM"</span> //PhpSTORMで設定したideKey  \nxdebug.remote_host=xxx.xxx.xxx.xxx  \n</code></pre>\n      </div>\n<h3>Apacheをリスタート</h3>\n<div class="gatsby-highlight">\n      <pre class="language-command"><code class="language-command">service httpd restart</code></pre>\n      </div>\n<h2>2. PhpStormでの設定</h2>\n<h3>リモートホストの設定</h3>\n<h4>1.Remote Hostを表示</h4>\n<p>[ Tools > Deployment > Browse Remote Host ]をクリックする</p>\n<h4>2. サーバーを登録</h4>\n<p>[ Tools > Deployment > Configuration… ]　を開く</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/phpstorm-setting-1-d71f3c0ed33d5027e8427ca197bd5e4a-89d2d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 80.37109375000001%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="phpstorm setting 1"\n        title=""\n        src="/static/phpstorm-setting-1-d71f3c0ed33d5027e8427ca197bd5e4a-48538.png"\n        srcset="/static/phpstorm-setting-1-d71f3c0ed33d5027e8427ca197bd5e4a-bed0f.png 200w,\n/static/phpstorm-setting-1-d71f3c0ed33d5027e8427ca197bd5e4a-5fd34.png 400w,\n/static/phpstorm-setting-1-d71f3c0ed33d5027e8427ca197bd5e4a-48538.png 800w,\n/static/phpstorm-setting-1-d71f3c0ed33d5027e8427ca197bd5e4a-89d2d.png 1024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ul>\n<li><code class="language-text">[test SFTP connection]</code> をクリックし、成功することを確認</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/phpstorm-setting-2-fdf7f868c83a494c40e746839f373f84-89d2d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.1171875%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="phpstorm setting 2"\n        title=""\n        src="/static/phpstorm-setting-2-fdf7f868c83a494c40e746839f373f84-48538.png"\n        srcset="/static/phpstorm-setting-2-fdf7f868c83a494c40e746839f373f84-bed0f.png 200w,\n/static/phpstorm-setting-2-fdf7f868c83a494c40e746839f373f84-5fd34.png 400w,\n/static/phpstorm-setting-2-fdf7f868c83a494c40e746839f373f84-48538.png 800w,\n/static/phpstorm-setting-2-fdf7f868c83a494c40e746839f373f84-89d2d.png 1024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>PHPリモートデバッグの設定</h3>\n<p>[ Run > Edit Configurations… ]　を開く</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/phpstorm-setting-3-f4fdeb8f7e9b1c3270dac898015d3295-89d2d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 57.421875%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="phpstorm setting 3"\n        title=""\n        src="/static/phpstorm-setting-3-f4fdeb8f7e9b1c3270dac898015d3295-48538.png"\n        srcset="/static/phpstorm-setting-3-f4fdeb8f7e9b1c3270dac898015d3295-bed0f.png 200w,\n/static/phpstorm-setting-3-f4fdeb8f7e9b1c3270dac898015d3295-5fd34.png 400w,\n/static/phpstorm-setting-3-f4fdeb8f7e9b1c3270dac898015d3295-48538.png 800w,\n/static/phpstorm-setting-3-f4fdeb8f7e9b1c3270dac898015d3295-89d2d.png 1024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol>\n<li>PHP Remote Debugをクリック</li>\n<li>名前、サーバーIPアドレス、Ide Key(※php.iniで設定したKey)\nなどを設定する</li>\n</ol>\n<p>これでPhpStorm + Xdebugでリモートデスクトップ環境構築完了！</p>',fields:{slug:"/phpstorm-remote-setting/",prefix:"2017-12-04"},frontmatter:{title:"PhpStorm + Xdebugでリモートデスクトップ",subTitle:"",cover:{childImageSharp:{resize:{src:"/static/php-storm-db0ae4049094253e133e8cf96f71ad80-160fa.png"}}}}},author:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><strong>jslee</strong> <br> lighthouse.log</p>"},footnote:{id:"/Users/leejuseung/Work/blog/lighthouse-dev.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li><a href="https://lighthouse-dev.github.io/">lighthouse.log</a></li>\n</ul>'},site:{siteMetadata:{facebook:{appId:"152072888976323"}}}},pathContext:{slug:"/phpstorm-remote-setting/"}}}});
